import React from "react";
import { Link } from "react-router-dom";

export default function Welcome(props) {
 
  
    
  return (
    <>
    <div className="container" style={{display:"flex"}}>
      <button type="button" className="btn btn-outline-success" onClick={props.handleonclicklogin}> <Link style={{textDecoration:"none",color:"black"}} to="/login">Login/signup for farmers</Link></button>
      <button type="button" className="btn btn-outline-success"onClick={props.handleonclicklogin}><Link style={{textDecoration:"none",color:"black"}} to="/login">Login/signup for user</Link></button>
    </div>
    </>
  )
}
